A comedy podcast featuring New York Stand up comedians and best friends Anthony Devito, Brendan Eyre, and Greg Stone. The Rad Dudecast is part wild improv and part off-the-rails comedy writer’s room. Is it satire? Is it parody? Or is it the only true thing you’ve ever heard. How do jokes form? What makes something funny? Find out on the Rad Dudecast. Recorded at Remember2BHappy Studios in Brooklyn. 

4 Bonus episodes a month for $5 at Patreon.com/raddudecast 

